import React from 'react'
import { Col, Container, Jumbotron, Row } from 'react-bootstrap';

function Hero(){
    return(
        <Jumbotron>
            <Container>
                <Row>
                    <Col>
                        <h2>Jamil Naber</h2>
                    </Col>
                </Row>  
            </Container>  
        </Jumbotron>
    );
}

export default Hero
